import React from "react";
import ReactDOM from "react-dom";
import "./App.css";

function Header() {
  return (
    <header>
      <h1>Frigus</h1>
    </header>
  );
}

function Main() {
  return (
    <>
      <ul>
        <Sectiontitle>
          <h1>My Fridge</h1>
        </Sectiontitle>
        <Section1>
          <h1>Top shelf</h1>
        </Section1>
        <Section2>
          <h1>Middle shelf</h1>
        </Section2>
        <Section3>
          <h1>Lower shelf</h1>
        </Section3>
      </ul>

      <Product>
        <h1>Manage me!</h1>
      </Product>

      <Recipes>
        <h1>Cook me!</h1>
      </Recipes>
    </>
  );
}

function Footer() {
  return (
    <footer>
      <h1>copyright</h1>
      <h1>contact info</h1>
    </footer>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
